window.bookSummaryJSON = "<b>A state trooper searching for her sister.<br>A prosecutor holding back answers.<br>A hunt for a lustful killer that proves the world isn't so black and white.</b><br><br>Rowan Wells doesn’t believe her sister is dead. She’ll do anything get answers, but when a body soaked in bleach and strangled with razor wire turns up in an abandoned building, she must face a terrifying truth: her sister’s abductor is back. Even worse, as the hot one-night stand meant to ease her grief turns up at the crime scene, Rowan realizes her personal life just compromised the investigation.<br><br>US Attorney Faust Hardwin didn’t meet Rowan by coincidence. Her tenacity to solve crimes hides a vulnerability that has shattered his defenses, but now Seattle has a new serial killer. One tied to Rowan. He can’t let his feelings for the guarded trooper hinder a conviction. But as they close in on answers and draw closer together, they’re caught in a twisted game of cat and mouse.<br><br>To survive, Rowan and Faust will have to contend with truths neither of them want to face: lust never lasts. And everyone is lying."; 
